import { Line } from 'react-chartjs-2';
import { store } from '../store';

const apiKey = process.env.API_KEY;

export default class CompanyChart extends Component {
        state = {
            // symbol = store.currentCompanySymbol,
            chartData: {
                labels: ['1', '2', '3', '4', '5', '6'],
                datasets: [
                    {
                        label: '# of Votes',
                        data: [12, 19, 3, 5, 2, 3],
                        fill: false,
                        backgroundColor: 'rgb(54, 162, 235)',
                        borderColor: 'rgba(54, 162, 235, 0.2)',
                    },
                ],
            },
            chartOptions: {
                scales: {
                    yAxes: [
                        {
                            ticks: {
                                beginAtZero: true,
                            },
                        },
                    ],
                },
            }
    }

    componentDidMount() {
            fetch(`https://www.alphavantage.co/query?function=TIME_SERIES_DAILY&symbol=${store.currentCompanySymbol}&apikey=${apiKey}`)
            .then((res) => res.json())
            .then((data) => {
                const closeData = (Object.values(data["Time Series (Daily)"]))
                const mappedData = closeData.map((chartData) => chartData)
                console.log(closeData)
            })
